text_:
To be honest, I haven't eaten chicken in nearly 30 years so maybe I'm not the best one to critique a "chicken flavored" item, but I am telling you -- the taste of this took me back to 1990. It tastes like chicken from what I remember! I originally bought it to make a broth to pour over my dogs' kibble... however, now I think I might have plans for it for myself, lol.

// UPDATE SINCE PURCHASE ///
I still stand by what I wrote about this product; that it's a vegan version of what I think taste like chicken. However, after looking at the Sodium content to this product, I am unable to feel relaxed consuming it, or even sharing it with my dogs, due to its high Sodium level. It saddens me because, yes, it really takes amazing. I am lowering it 1 star due to that Sodium factor. I don't want to lower it further than that because I feel the company made a good product, it's just that bouillion sodium is tricky for some of us.
